import React, {useState, useEffect} from 'react'

function GameTile(props) {

    // function logMyProps(e){
    //     e.preventDefault();
    //     console.log(props.gameData);
    // }

    return(

        <div className='slot'>
{/*             
        <button onClick={(e) => {
          logMyProps(e);
        }}>log props</button> */}

            <div className='platform-icon'>
                <img className='slot-platform-icon' 
                    alt={()=> {
                        switch(props.gateData.platform){
                            case 'ps4':
                                return 'PS4' + 'Game Platform Logo'
                            case 'xbox':
                                return 'Xbox' + 'Game Platform Logo'
                            case 'switch':
                                return 'Nintendo Switch' + 'Game Platform Logo'
                            case 'pc':
                                return 'PC' + 'Game Platform Logo'
                        }
                    }}

                    src={() => {
                        switch(props.dateData.platform){
                            case 'ps4':
                                return 'PS4' + 'Game Platform Logo'
                            case 'xbox':
                                return 'Xbox' + 'Game Platform Logo'
                            case 'switch':
                                return 'Nintendo Switch' + 'Game Platform Logo'
                            case 'pc':
                                return 'https://upload.wikimedia.org/wikipedia/commons/8/83/Steam_icon_logo.svg'
                        }
                    }}/>
            </div>

            <div>
               Name: {props.gameData.name}
            </div>
            <div>
                Beat: {props.gameData.beat + ''}
            </div>
            <div>
                Desire to Play: {props.gameData.desireToPlay}
            </div>
            <div>
                Icon: {props.gameData.icon}
            </div>
            <div>
                Owned: {props.gameData.owned + ''}
            </div>
            <div>
                Platform: {props.gameData.platform}
            </div>

        </div>


    )
}

export default GameTile;
